import React from 'react';
import ReactDOM from 'react-dom';
import SendFriendRequestButton from './sendFriendRequest';

document.addEventListener("DOMContentLoaded", function() {
  const rootElement = document.getElementById('friend-request-root');
  const profileId = rootElement.getAttribute('data-profile-id');
  
  ReactDOM.render(
    <React.StrictMode>
      <SendFriendRequestButton profileId={profileId} />
    </React.StrictMode>,
    rootElement
  );
});
